import React from 'react';
import { Link } from 'react-router-dom';
import SearchBox from '../SearchBox/SearchBox';


export default function Nav() {
  return (
    <>
        <div className= 'search'>
                <p>Search</p>
                  <Link to='/search'/>
                <SearchBox/>
        </div>
        <div className= 'saved'>
                <p>Saved</p>
                <Link to='/saved'/>
        </div>
    </>    
  )
}
